(2, 1, 'How to convert a title to a URL slug in ReactJs?', '<h3><br></h3><h3>Here is the best solutin for convert URL slug using javascript.</h3><h3><br></h3><h3><span class=\"ql-font-monospace\" style=\"background-color: rgb(241, 241, 241);\">toLowerCase</span> is the function for converting all string into lower case. </h3><h3><br></h3><h3>and below are the syntax, </h3><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">value = value.replace(/[^a-z0-9]/g, \'-\') .replace(/\\-{2,}/g, \'-\') .toLowerCase(); </pre><p><br></p><p><br></p><p><br></p><h3><strong style=\"color: rgb(61, 20, 102);\">A \'+\' after a character set will convert multiple sequences of characters to a line, like \'@\'.</strong></h3><p><br></p><p><br></p><p><br></p><h3><strong>Thank you. </strong></h3>', NULL, 'how-to-convert-a-title-to-a-url-slug-in-reactjs', NULL, 1, 0, 0, 0, 0, '2022-12-04 17:02:11', '2022-12-04 17:02:11', NULL, 'Thilagaraja '),
(4, 1, 'How to enable cors in laravel?', '<h3><strong style=\"color: rgb(61, 20, 102);\">நான் எப்போதும் எளிதான முறையைப் பயன்படுத்துகிறேன். \\public\\index.php கோப்பில் கீழே உள்ள வரிகளைச் சேர்க்கவும். நீங்கள் மிடில்வேரைப் பயன்படுத்த வேண்டியதில்லை என்று நான் நினைக்கிறேன்.</strong></h3><h3><br></h3><pre class=\"ql-syntax\" spellcheck=\"false\">header(\'Access-Control-Allow-Origin: *\'); header(\'Access-Control-Allow-Methods: GET, PUT, POST, DELETE, OPTIONS\'); </pre><h3><br></h3><h3><br></h3><h3><br></h3><h3><strong style=\"color: rgb(61, 20, 102);\">Thanks</strong></h3>', NULL, 'how-to-enable-cors-in-laravel', 'saha2103', 1, 0, 0, 0, 0, '2022-12-04 18:26:35', '2022-12-04 18:26:35', NULL, ' thilagaraja'),
(5, 1, 'How to Unzip a file in Ubuntu Server?', '<p><strong>Intro</strong></p><p><br></p><p><span style=\"color: rgb(64, 64, 64);\">This guide will let you know about unzip a file into ubuntu server. </span></p><p><br></p><p><span style=\"color: rgb(64, 64, 64);\">Run below Command in ubuntu server</span></p><p><br></p><p><span class=\"ql-font-monospace\" style=\"background-color: rgb(241, 241, 241); color: rgb(64, 64, 64);\">sudo apt-get install zip unzip</span></p><p><br></p><p>And goto the file folder and run below command, </p><p><br></p><p><span class=\"ql-font-monospace\" style=\"background-color: rgb(241, 241, 241); color: rgb(64, 64, 64);\">unzip test.zip</span></p><p><br></p><p>The system will extract the sample.zip file, and place a copy of its contents in the same directory.</p><p><br></p><p><br></p><p><br></p><h3><strong>Thanks. </strong></h3>', NULL, 'how-to-unzip-a-file-in-ubuntu-server', 'saha2103', 1, 0, 0, 0, 0, '2022-12-04 19:40:00', '2022-12-04 19:40:00', NULL, 'Thilagaraja '),
(6, 1, 'How To Set up  virtual hosts on the Ubuntu OS in Apache', '<p><strong>Welcome,</strong></p><p><br></p><p>This tutorial will let you know about hosting of <strong><em>one or more than one domains</em></strong> on a  server.  This method is knowns as <strong>Virtual Hosting. </strong>Now we can see the step by step guide as below, </p><p><br></p><p><strong>Step 1 :- Create a host folder</strong></p><p><br></p><p>First, we need to create a folder for our domain “domainname.in” under  your home directory. If you want you can be specify domain name as folder name like below command,</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">sudo mkdir -p /var/www/domainname.in\r\n</pre><p><br></p><p><strong>Step 2 :- Create a index.html file under host folder along with basic UI</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">sudo vim /var/www/domainname.in/index.html\r\n</pre><p><br></p><p>After creating a file, you write a basic content like below. </p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">&lt;html&gt;\r\n\r\n  &lt;head&gt;\r\n\r\n    &lt;title&gt;Welcome to domainname.in!&lt;/title&gt;\r\n\r\n  &lt;/head&gt;\r\n\r\n  &lt;body&gt; &lt;h1&gt;Success! The domainname.in virtual host is working!&lt;/h1&gt;\r\n\r\n  &lt;/body&gt;\r\n\r\n&lt;/html&gt;\r\n</pre><p><br></p><p>Now we need to define virtual hosts.</p><p><br></p><p><strong>Step 3:- Create a virtual host file as below,</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">sudo vim /etc/apache2/sites-available/domainname.in.conf\r\n</pre><p><br></p><p>Then enter below line using vim editor</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">&lt;VirtualHost *:80&gt;\r\n\r\n        ServerName www.domainname.in\r\n\r\n       ServerAlias domainname.in\r\n\r\n        DocumentRoot /var/www/domainname.in\r\n\r\n        ErrorLog /var/log/apache2/domainname.in_error.log\r\n\r\n        CustomLog  /var/log/apache2/domainname.in_access.log combined\r\n\r\n        RewriteEngine on\r\n\r\n        RewriteCond %{SERVER_NAME} =domainname.in [OR]\r\n\r\n        RewriteCond %{SERVER_NAME} =www.domainname.in\r\n\r\n        RewriteRule ^ https://%{SERVER_NAME}%{REQUEST_URI} [END,NE,R=permanent]\r\n\r\n&lt;/VirtualHost&gt;\r\n</pre><p><br></p><p><br></p><p><br></p><p><strong>Step 4:- Enable the above created virtual host domain file as below command</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">sudo a2ensite domainname.in.conf\r\n</pre><p><br></p><p><br></p><p><br></p><p><strong>Step 5:- Restart the apache server as below command, </strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">sudo systemctl restart apache2\r\n</pre><p><br></p><p><br></p><p><br></p><p><strong>Step 6:- Check the browser for sample webpage loading status, enter below url in you website. </strong></p><p><span style=\"color: rgb(97, 189, 109);\">https://domainname.in</span></p><p><br></p><p><em style=\"color: rgb(40, 50, 78);\">Note: Before test a wepage you should configure nameserver against this domain. </em></p><p><br></p><p><br></p><p><br></p><p><strong style=\"color: rgb(40, 50, 78);\">You can see a web page that show like this:</strong></p><p><br></p><p><span style=\"color: rgb(40, 50, 78);\">Success! The domainname.in virtual host is working!</span></p><p><br></p><p><br></p><p><br></p><p><strong>Step 7:- Check the log file.</strong></p><p><br></p><p>As defined in the hosts file, it has seperate log file.</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\"> cat /var/log/apache2/domainname.in_error.log\r\n</pre><p><br></p><p><br></p><p><br></p><p><strong>Thank you for reading this. </strong></p><p><br></p><p><br></p><p><br></p><p><em>Regards</em><strong>,</strong></p><p><br></p><p><em>Thilagaraja Sekar.  Senior Software engineer.  </em></p><p><br></p><p><strong style=\"color: rgb(184, 49, 47);\"><em>Note: If anything found wrong on above artical feel free to draft a mail to following email (thilakazb@gmail.com). </em></strong></p><p><br></p><p><br></p>', NULL, 'how-to-set-up--virtual-hosts-on-the-ubuntu-os-in-apache', 'saha2103', 1, 0, 0, 0, 0, '2022-12-05 17:55:05', '2022-12-05 17:55:05', NULL, 'Thilagaraja'),
(7, 1, 'Best Text editor package in ReactJs - ReactQuill', '<p>Welcome to developerconsole.in</p><p><br></p><p>A Quill is a component for ReactJs.</p><p><br></p><p><strong>NPM Install command</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">$ npm i react-quill\n</pre><p><br></p><p>The best text editor for ReactJS is Quill.</p><p><br></p><p>Below are the example usage</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">import ReactQuill from \'react-quill\';\nimport \'react-quill/dist/quill.snow.css\';\n</pre><p><br></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">const modules = {\n&nbsp;&nbsp;&nbsp;toolbar: [\n&nbsp;&nbsp;&nbsp;&nbsp;[\'blockquote\', \'code-block\'],\n&nbsp;&nbsp;&nbsp;&nbsp;[{ \'header\': [1, 2, 3, 4, 5, 6, false] }],\n&nbsp;&nbsp;&nbsp;&nbsp;[\'bold\', \'italic\', \'underline\',\'strike\', \'blockquote\'],\n&nbsp;&nbsp;&nbsp;&nbsp;[{\'list\': \'ordered\'}, {\'list\': \'bullet\'}, {\'indent\': \'-1\'}, {\'indent\': \'+1\'}],\n&nbsp;&nbsp;&nbsp;&nbsp;[\'link\', \'image\'],\n&nbsp;&nbsp;&nbsp;&nbsp;[\'clean\'],\n&nbsp;&nbsp;&nbsp;&nbsp;[{ \'color\': [] }, { \'background\': [] }],&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;],\n&nbsp;&nbsp;};\n</pre><p><br></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">&nbsp;&lt;ReactQuill theme=\"snow\" value={answervalue} onChange={setAnswervalue} modules={modules} sticky_toolbar={true}/&gt;\n</pre><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">&nbsp;.text-editor{\n&nbsp;&nbsp;overflow: hidden;\n&nbsp;}\n&nbsp;.ql-container{\n&nbsp;&nbsp;height: 300px !important;\n&nbsp;&nbsp;overflow: scroll;\n&nbsp;}\n</pre>', NULL, 'best-text-editor-package-in-reactjs---reactquill', 'saha2103', 1, 0, 0, 0, 0, '2022-12-16 04:25:26', '2022-12-16 04:25:26', NULL, 'Thilagaraja '),
(10, 1, 'Best autocomplete plugin for search bar in ReactJs', '<h1>ReactJS Auto Complete</h1><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">&lt;ReactSearchAutocomplete&gt;\n</pre><p><br></p><h3><strong>npm package install command: </strong></h3><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">npm i react-search-autocomplete\n</pre><p><br></p><h3><strong>Export as below</strong></h3><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">import { ReactSearchAutocomplete } from \'react-search-autocomplete\'\n</pre><p><br></p><p><br></p><h3><strong>Usage </strong></h3><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">import React, {useState, useEffect} from \'react\'\nimport axios from \"axios\";\nimport { ReactSearchAutocomplete } from \'react-search-autocomplete\'\nimport { useNavigate   } from \"react-router-dom\";\n\n\nconst baseURL = process.env.REACT_APP_BASEURL;\nconst app_module = process.env.REACT_APP_MODULE;\n\nconst SearchBar = (data) =&gt; {\n  let navigate = useNavigate();\n\n  const [items, setItems] = useState([]);\n\n \n  const handleOnSearch = (string, results) =&gt; {\n    // onSearch will have as the first callback parameter\n    // the string searched and for the second the results.\n    console.log(string, results)\n  }\n\n  const handleOnHover = (result) =&gt; {\n    // the item hovered\n    console.log(result)\n  }\n\n  const handleOnSelect = (item) =&gt; {\n    // the item selected\n    console.log(item)\n    navigate(\"/search/\"+item.link);\n  }\n\n  const handleOnFocus = () =&gt; {\n    axios.get(baseURL+\"/api/posts/\"+app_module+\"?use=searchbar\").then((response) =&gt; {\n      setItems(response.data.data);\n      console.log(items);\n  });\n  }\n\n  const formatResult = (item) =&gt; {\n    return (\n      &lt;&gt;\n        &lt;span style={{  textAlign: \'left\'}}&gt; {item.name}&lt;/span&gt;\n      &lt;/&gt;\n    )\n  }\n\n  return (\n    &lt;&gt;\n    &lt;ReactSearchAutocomplete\n            items={items}\n            onSearch={handleOnSearch}\n            onHover={handleOnHover}\n            onSelect={handleOnSelect}\n            onFocus={handleOnFocus}\n            autoFocus\n            formatResult={formatResult}\n            styling={\n              {lineColor: \"rgb(10, 133, 10)\", zIndex :\"100\",border: \"1px solid #dfe1e5\",hoverBackgroundColor: \"#eee\",color: \"green\"}\n             }\n             showNoResults\n             showIcon\n             showClear\n             placeholder=\"Serach whatever you think....\"\n             fuseOptions={{ keys: [\"name\"] }}\n          /&gt;\n          &lt;hr/&gt;\n      &lt;/&gt;\n  )\n}\n\nexport default SearchBar\n</pre><p><br></p><p><br></p><h3>Note :</h3><h3><br></h3><h3><em>In fuseOptions prop&nbsp;`keys` represent the keys in `items` where the search will be performed.</em></h3><h3 class=\"ql-indent-1\"><em>fuseOptions={{ keys: [\"title\", \"description\"] }}</em></h3><p><br></p>', NULL, 'best-autocomplete-plugin-for-search-bar-in-reactjs', 'saha2103', 1, 0, 0, 0, 0, '2022-12-23 20:26:27', '2022-12-23 20:26:27', NULL, 'Thilagaraja ');
