(11, 1, 'what is raspberry pi ? ', '<h2><strong>what is raspberry pi ?&nbsp;</strong></h2><p><br></p><ol><li>The Raspberry Pi is an inexpensive, credit card-sized computer that plugs into a computer monitor or TV and uses a standard keyboard and mouse.</li><li>It\'s a portable device that helps people of all ages explore computing and learn how to program in languages ​​like Scratch and Python.</li><li>For people of all ages to explore computing and learn how to program in languages ​​like Scratch and Python.</li><li>From browsing the web and playing high-definition games to creating spreadsheets, word processing, and playing games,</li><li>it\'s capable of doing everything you\'d expect a desktop computer to do.</li></ol><p><br></p><p><img src=\"data:image/jpeg;base64,\"></p><p><br></p><ol><li>Its run in Linux server.</li><li>It is also brings a pair of General purpose input and output pins, allows you to control electronic components for physical computing and explore the IOT.</li></ol><p><br></p><h2><strong>Raspberry Pi Foundation</strong></h2><p><br></p><ol><li>The Raspberry Pi Foundation is a registered educational charity belongs to United Kingdom.&nbsp;</li><li>Raspberry Pi Foundation in association with Broadcom.</li></ol><h2><br></h2><p><br></p><h2><strong> Raspberry Pi Family / Models</strong></h2><ol><li>Raspberry Pi</li><li>Raspberry Pi 2</li><li>Raspberry Pi Zero</li><li>Raspberry Pi 3</li><li>Raspberry Pi 4</li><li>Raspberry Pi Pico</li></ol><p><br></p><p><br></p>', NULL, 'what-is-raspberry-pi--', 'saha2103', 1, 0, 0, 0, 0, '2022-12-24 11:55:57', '2022-12-24 11:55:57', NULL, 'Darsh ');
