(12, 1, 'How to Select Custom Column with constant Value in Laravel eloquent Query?', '<p>Hello,</p><p><br></p><p>This article will bring example of Laravel query add custom column.&nbsp;</p><p><br></p><p>Bellow are the example:-</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">&lt;?php &nbsp;&nbsp; namespace App\\Http\\Controllers; &nbsp;&nbsp; use App\\Models\\User; use DB; &nbsp;&nbsp; class UserController extends Controller { &nbsp; &nbsp; /** &nbsp; &nbsp; &nbsp;* code here &nbsp; &nbsp; &nbsp;* &nbsp; &nbsp; &nbsp;* @return response() &nbsp; &nbsp; &nbsp;*/ &nbsp; &nbsp; public function getUser() &nbsp; &nbsp; { &nbsp; &nbsp; &nbsp; &nbsp; $users = User::select([ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \"id\",&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \"name\",&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; DB::raw(\"\'10%\' as increment\"), &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; DB::raw(\"1 as enable\") &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ])-&gt;get(); &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return $users-&gt;toArray(); &nbsp; &nbsp; } } </pre><p><br></p><p>Result:</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\"> Array ( &nbsp; &nbsp; [0] =&gt; Array &nbsp; &nbsp; &nbsp; &nbsp; ( &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [id] =&gt; 1 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [name] =&gt;\"Thilak\" &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [increment] =&gt; 10% &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [enable] =&gt; 1 &nbsp; &nbsp; &nbsp; &nbsp; ) &nbsp; &nbsp; [1] =&gt; Array &nbsp; &nbsp; &nbsp; &nbsp; ( &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [id] =&gt; 2 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [name] =&gt; \"Saha\" &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [increment] =&gt; 10% &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [enable] =&gt; 1 &nbsp; &nbsp; &nbsp; &nbsp; ) ) </pre><p><br></p><p><br></p><p>Happy coding. </p>', NULL, 'How-to-Select-Custom-Column-with-constant-Value-in-Laravel-eloquent-query', 'saha2103', 1, 0, 0, 0, 0, '2023-01-04 11:55:57', '2023-01-04 11:55:57', NULL, 'Darsh ');

